//seriesHistogramChart = dc.barChart("#series-histogram-chart");
//seriesRow = dc.rowChart("#series-row-chart");
algoPie = dc.pieChart("#algo-pie-chart");
timeVsVolumeScatter = dc.scatterPlot("#timevsvolume-chart");

makePlot = function(data) {

  var ndx             = crossfilter(data),
      allAccess = ndx.groupAll(),
      sessionDimension   = ndx.dimension(function(d) {return d.ActivitySession;}),
      sessionGroup       = sessionDimension.group(),
      algoDimension  = ndx.dimension(function(d) {return d.AlgorithmType;}),
      algoGroup  = algoDimension.group(),
      readerDimension  = ndx.dimension(function(d) {return d.PersonObserverName;}),
      readerGroup  = readerDimension.group(),
      volumeDimension  = ndx.dimension(function(d) {return d.Volume;}),
      volumeGroup  = volumeDimension.group();
      timePointDimension  = ndx.dimension(function(d) {return d.TimePoint;}),
      timePointGroup  = timePointDimension.group();

      /*
      instanceCountDimension      = ndx.dimension(function(d) {return d.instanceCount;}),
      instanceCountHistogram      = instanceCountDimension.group().reduceCount(),
      seriesDescriptionPerInstanceCount = seriesDimension.group().reduceSum(
        function(d) {return d.instanceCount;});


  var keyAndPercentValueLabel = function (total_value, d) {
      console.log(total_value, d);
      return "" + d.key + "  (" + d3.round(d.value/total_value*100.0, 0) + "%)";
  };*/

  algoPie
    .width(850)
    .height(340)
    .radius(150)
    .cx(170)
    .dimension(algoDimension)
    .group(algoGroup)
    .title( function(p) {return "Algorithm type"} )
    .legend(dc.legend().x(300).y(10).itemHeight(13).gap(5));

    timeVsVolumeScatter
      .width(768)
      .height(480)
      .x(d3.scale.linear().domain([6,20]))
      .brushOn(false)
      .symbolSize(8)
      .clipPadding(10)
      .yAxisLabel("This is the Y Axis!")
      .dimension(timePointDimension)
      .group(volumeGroup);

/*
  seriesHistogramChart
    .width(850).height(400)
    .dimension(instanceCountDimension)

    .xUnits(dc.units.ordinal)
    .xAxisLabel("# of Instances in Series")
    .yAxisLabel("# of per-Series Count in Dataset")
    .elasticY(true);

  seriesRow
    .width(300)
    .height(1540)
    .elasticX(true)
    .dimension(seriesDimension)
    .group(seriesGroup)
    .label(function(x) { return keyAndPercentValueLabel(allAccess.value(), x) })
    .legend(dc.legend().x(300).y(10).itemHeight(10).gap(3))
    .xAxis().ticks(4);
*/
  dc.renderAll();
};
